player_projections = {}

# Parse the HTML content using BeautifulSoup
soup = BeautifulSoup(html_text, 'lxml')

# This is a more robust method.
# 1. Find all tags that contain the unique phrase for a player's name.
name_tags = soup.find_all(lambda tag: tag.name in ['span', 'h3'] and 'Regular Season Total Receiving Yards' in tag.get_text())

# 2. Loop through each name tag we found.
for tag in name_tags:
    # 3. For each name, find its main parent container (the <li> element).
    # This isolates the search to just that player's block.
    parent_li = tag.find_parent('li')

    if parent_li:
        # 4. Now, search ONLY within that player's block for the yardage line.
        yards_tag = parent_li.find(lambda t: t.name == 'span' and t.get_text(strip=True).startswith('Over '))

        # 5. If we successfully find both, extract the data.
        if yards_tag:
            full_name_text = tag.get_text(strip=True)
            player_name = full_name_text.replace('Regular Season Total Receiving Yards 2025-26', '').strip()

            full_yards_text = yards_tag.get_text(strip=True)
            yards_match = re.search(r'(\d+\.\d+)', full_yards_text)
            
            if player_name and yards_match:
                yards = float(yards_match.group(1))
                # Add the clean data to our dictionary
                player_projections[player_name] = yards

# --- Display and Save the Results ---
print("--- Extracted Player Yardage Lines (Advanced BeautifulSoup Method) ---")
if player_projections:
    df_output = pd.DataFrame(list(player_projections.items()), columns=['name', 'fanduel_yds_line'])
    print(df_output)

    output_filename = "fanduel_yds_lines.csv"
    df_output.to_csv(output_filename, index=False)
    print(f"\nResults have been saved to {output_filename}")
else:
    print("No players were found. Please ensure the full HTML was pasted correctly.")















